import React, { useState, useEffect } from 'react';

const ResultPage = () => {
  const [internshipResults, setInternshipResults] = useState([]);
  const [studentID, setStudentID] = useState('');
  const [error, setError] = useState(null);

  const validateStudentID = () => {
    // Kiểm tra mã số sinh viên có hợp lệ không
    if (studentID !== 'your_correct_student_id') {
      setError('Mã số sinh viên không chính xác.');
      return false;
    }
    return true;
  };

  useEffect(() => {
    // Nếu mã số sinh viên hợp lệ thì gọi API để lấy dữ liệu
    if (validateStudentID()) {
      fetch('your_api_endpoint')
        .then(response => response.json())
        .then(data => setInternshipResults(data))
        .catch(error => console.error('Error fetching data:', error));
    }
  }, [studentID]);

  return (
    <div>
      <h2>Kết quả thực tập</h2>
      <input
        type="text"
        value={studentID}
        onChange={e => setStudentID(e.target.value)}
        placeholder="Nhập mã số sinh viên"
      />
      {error && <p>{error}</p>}
      <table>
        {/* ... */}
      </table>
    </div>
  );
};

export default ResultPage;
